import React from "react";
import styled from "styled-components";
import InputBox from "../components/Share/InputBox";

const Background = styled.div`
  width: 100vw;
  min-height: 100vh;
  background: #e29f91;

  display: flex;
  justify-content: center;
  align-items: center;
`;

const Box = styled.div`
  width: 540px;
  height: 746px;
`;

const TitleText = styled.div`
  color: #000;
  font-family: Roboto;
  font-size: 32px;
  font-style: normal;
  font-weight: 600;
  line-height: 40px;
`;

export default function Signup() {
  return (
    <Background>
      <Box>
        <TitleText>회원가입</TitleText>
        <InputBox label="이름" type="text"></InputBox>
        <InputBox label="이메일" type="email"></InputBox>
        <InputBox label="닉네임" type="email"></InputBox>
        <InputBox label="비밀번호" type="password"></InputBox>
      </Box>
    </Background>
  );
}
